    {id: "todo-0", name:"Eat", completed: false},
    {id: "todo-1", name:"Sleep", completed: false},
    {id: "todo-2", name:"Repeat", completed: false},
]

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App subject="Dani"/>);
